import * as React from 'react';
import {Link} from "react-router-dom";
import './sidenav.css';
import Folder from '../MenuIcons/FolderSimple.svg';

export function SideNav() {
    const menuElements = [
        {
            icon:Folder,
            title: 'Films',
            path: '/films'
        },
        {
            icon:Folder,
            title: 'People',
            path: '/people'
        },
        {
            icon:Folder,
            title: 'Planets',
            path: '/planets'
        }
        ,
        {
            icon:Folder,
            title: 'Species',
            path: '/species'
        }
        ,
        {
            icon:Folder,
            title: 'Starships',
            path: '/starships'
        }
        ,
        {
            icon:Folder,
            title: 'Vehicles',
            path: '/vehicles'
        }

    ];
    return (
        <div>
            <ul className={`sideMenuOptions`}>
                {menuElements.map((element, index) => (
                    <li key={index} className={`sideMenuOption`}>
                      <img src={Folder} alt={"menuLogo"}/>
                        <Link to={element.path} className={`sideMenuOptionLink`}>

                            <span>{element.title}</span>
                        </Link>
                    </li>
                ))}
            </ul>



        </div>
    );
}
